import ReactDOM from 'react-dom/client';
import Car from './Car';

function FirstForm () {
    return (
        <>
            <h1>Who lives in my garage?</h1>
            <ul>
                {cars.map((car) => <Car key={car.id} brand={car.brand} />)}
            </ul>
        </>
    );
}

